public Attribute(String key, String value) {
Validate.notEmpty(key);
Validate.notNull(value);
this.key = key.trim().toLowerCase();
this.value = value;
}

public String getKey() {
return key;
}

protected void html(StringBuilder accum, Document.OutputSettings out) {
accum.append(key);
if (!shouldCollapseAttribute(out)) {
accum.append("=\"");
Entities.escape(accum, value, out, true, false, false);
accum.append('"');
}

protected final boolean shouldCollapseAttribute(Document.OutputSettings out) {
return ("".equals(value) || value.equalsIgnoreCase(key))
}

public boolean equals(Object o) {
if (this == o) return true;
if (!(o instanceof Attribute)) return false;
Attribute attribute = (Attribute) o;
if (key != null ? !key.equals(attribute.key) : attribute.key != null) return false;
if (value != null ? !value.equals(attribute.value) : attribute.value != null) return false;
return true;
}

boolean process(Token t, HtmlTreeBuilder tb) {
if (isWhitespace(t)) {
switch (t.type) {
Token.StartTag start = t.asStartTag();
String name = start.name();
if (name.equals("html")) {
} else if (StringUtil.in(name, "base", "basefont", "bgsound", "command", "link")) {
} else if (name.equals("meta")) {
} else if (name.equals("title")) {
} else if (StringUtil.in(name, "noframes", "style")) {
} else if (name.equals("noscript")) {
} else if (name.equals("script")) {
} else if (name.equals("head")) {
return anythingElse(t, tb);
Token.EndTag end = t.asEndTag();
name = end.name();
if (name.equals("head")) {
tb.pop();
tb.transition(AfterHead);
return true;
}

public static boolean isWhitespace(int c){
return c == ' ' || c == '\t' || c == '\n' || c == '\f' || c == '\r';
}

public static boolean in(String needle, String... haystack) {
for (String hay : haystack) {
if (hay.equals(needle))
return true;
return false;
}

public TextNode(String text, String baseUri) {
this.baseUri = baseUri;
this.text = text;
}

public String nodeName() {
return "#text";
}

public String getWholeText() {
return attributes == null ? text : attributes.get(TEXT_KEY);
}

void outerHtmlHead(StringBuilder accum, int depth, Document.OutputSettings out) {
if (out.prettyPrint() && ((siblingIndex() == 0 && parentNode instanceof Element && ((Element) parentNode).tag().formatAsBlock() && !isBlank()) || (out.outline() && siblingNodes().size()>0 && !isBlank()) ))
boolean normaliseWhite = out.prettyPrint() && parent() instanceof Element
Entities.escape(accum, getWholeText(), out, false, normaliseWhite, false);
}
